import useInitialState from "./useInitalState";

const userDelete = (idUser, APIDELETE, API) => {
  var requestOptions = {
    method: "DELETE",
  };

  fetch(APIDELETE + idUser + "", requestOptions)
    .then((response) => response.text())
    .then(() => useInitialState)
    .catch((error) => console.log("error", error));
};

export default userDelete;
